AlbumFullResponse::VisibilityEnum AlbumFullResponse::toVisibilityEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("PUBLIC")) {
        return VisibilityEnum::PUBLIC;
    }
    
    if (value == utility::conversions::to_string_t("PRIVATE")) {
        return VisibilityEnum::PRIVATE;
    }
    
    if (value == utility::conversions::to_string_t("FRIENDS")) {
        return VisibilityEnum::FRIENDS;
    }
    
    throw std::invalid_argument("Invalid value for conversion to VisibilityEnum");
}


const utility::string_t AlbumFullResponse::fromVisibilityEnum(const VisibilityEnum value) const
{
    switch(value)
    {
        
        case VisibilityEnum::PUBLIC: return utility::conversions::to_string_t("PUBLIC");
        
        case VisibilityEnum::PRIVATE: return utility::conversions::to_string_t("PRIVATE");
        
        case VisibilityEnum::FRIENDS: return utility::conversions::to_string_t("FRIENDS");
        
    }
}

AlbumFullResponse::ApprovalStatusEnum AlbumFullResponse::toApprovalStatusEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("PENDING")) {
        return ApprovalStatusEnum::PENDING;
    }
    
    if (value == utility::conversions::to_string_t("REJECTED")) {
        return ApprovalStatusEnum::REJECTED;
    }
    
    if (value == utility::conversions::to_string_t("APPROVED")) {
        return ApprovalStatusEnum::APPROVED;
    }
    
    if (value == utility::conversions::to_string_t("FEATURED")) {
        return ApprovalStatusEnum::FEATURED;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ApprovalStatusEnum");
}


const utility::string_t AlbumFullResponse::fromApprovalStatusEnum(const ApprovalStatusEnum value) const
{
    switch(value)
    {
        
        case ApprovalStatusEnum::PENDING: return utility::conversions::to_string_t("PENDING");
        
        case ApprovalStatusEnum::REJECTED: return utility::conversions::to_string_t("REJECTED");
        
        case ApprovalStatusEnum::APPROVED: return utility::conversions::to_string_t("APPROVED");
        
        case ApprovalStatusEnum::FEATURED: return utility::conversions::to_string_t("FEATURED");
        
    }
}


